import React from "react";
import './Style/App.css'
import {BrowserRouter,Route} from "react-router-dom";
import About from "./Pages/About";
import Posts from "./Pages/Posts";


function App(){
  return (
    <BrowserRouter>
      <Route path="/about">
        <About/>
      </Route>
      <Route path="/posts">
        <Posts/>
      </Route>
      <div>Hello</div>
    </BrowserRouter>
  )
}

export default App;
